import React from "react";
import styled from "styled-components";
import party from "./img/party.png";
const StyleGame = styled.div`
    background-color: #37474f;
    width: 600px;
    height: 800px;
    margin: auto;
    margin-top: 100px;
`;

const Header = styled.div`
    background-color: #102027;
    width: 600px;
    height: 100px;
    margin: auto;
    text-align: center;
    line-height: 105px;
    font-size: 40px;
    font-family: "Jua", sans-serif;
    color: #f5f5f5;
`;

const Main = styled.div`
    background-color: white;
    width: 600px;
    height: 700px;
    background-color: #37474f;
`;

const InputBox = styled.div`
    border: 1px solid black;

    width: 450px;
    height: 50px;
    margin: auto;
    margin-top: 50px;
`;

const Input = styled.input`
    width: 300px;
    height: 30px;
`;
const Game = () => {
    return (
        <StyleGame>
            <Header>UP&DOWN GAME</Header>
            <Main>
                <InputBox>
                    <Input></Input>
                    <button></button>
                </InputBox>
            </Main>
        </StyleGame>
    );
};

export default Game;
